#et-boc > header > div > div > div > div.et_pb_column.et_pb_column_1_3.et_pb_column_1_tb_header.et_pb_css_mix_blend_mode_passthrough.et_pb_column--with-menu {
  width: auto !important;
  margin-right: 1.5% !important;
}
#et-boc > header > div > div > div {
	justify-content: space-between;
}

.current-menu-item {
  border-bottom: 2px solid #E2254A !important;
}
.et_pb_menu_0_tb_header.et_pb_menu nav>ul>li {
  margin: 0 15px !important;
  padding: 0 !important;
}
.et_pb_menu_0_tb_header.et_pb_menu nav>ul>li:hover {
  border-bottom: 2px solid #E2254A !important;
}
@media (max-width: 980px) {
  .et_pb_column {
    margin-bottom: 0px !important;
    width: auto;
  }
  .et_pb_column_0_tb_header {
    width: 25% !important;
  }
  .et_pb_column_1_tb_header {
    width: 100% !important;
  }
}
@media (max-width: 479px) {
  .et_pb_column_0_tb_header {
    width: 32% !important;
  }
  .et_pb_column_1 {
    width: 67% !important;
  }
}

footer p {
  font-size: 16px !important;
}

.et_contact_bottom_container {
  margin-top: 0 !important;
  width: 40%;
}

.et_pb_contact .et_pb_contact_field_half {
  width: 60%
}

.et-pb-contact-message {
  color: #EC6707;
}

@media (max-width: 1023px) {
  .et_pb_image_0_tb_footer {
  	margin: auto !important;  
  }

