  font-size: 14px !important;
}

  footer h6, footer p, footer li, footer ul, footer {
    text-align: center;
  }

  #et_pb_contact_form_0 {
    display: flex;
    justify-content: center;
  }

  .et_pb_contact_field_half, .et_pb_contact {
  	width: 100%;
	}

  footer form {
    width: 100%;
    display: flex;
    align-items: strech;
    justify-content: center;
    margin-left: 0 !important;
  }

  footer form p {
    width: 100% !important;
    max-width: 300px !important;
    margin: 0 !important;
  }

  footer form p input {
    width: 100%;
  }

  .et_contact_bottom_container {
    width: auto !important;
  }

